import React from 'react';
import Item from "./Item";
import Hoodie from "../../Assets/ClothesImg/hoodie.jpg";
import Hat from "../../Assets/ClothesImg/hat.jpg";
import Jacket from "../../Assets/ClothesImg/jacket.jpg";
import LongSleeve from "../../Assets/ClothesImg/long-sleeve.jpg";
import Pants from "../../Assets/ClothesImg/pink-pants.jpg";
import Nike from "../../Assets/ClothesImg/nike-shoes.jpg";
import Jeans from "../../Assets/ClothesImg/jeans.jpg";
import Sneakers from "../../Assets/ClothesImg/sneaker-shoe.jpg";

const FashionPage = () => {
    const fashionItems = [
        {
            id: 1,
            imageURL: Hoodie,
            title: 'Red Hoodie',
            rating: 4,
            price: 27.50
        },
        {
            id: 2,
            imageURL: Hat,
            title: 'Yellow Hat',
            rating: 5,
            price: 15.99
        },
        {
            id: 3,
            imageURL: Jacket,
            title: 'Bomber Jacket',
            rating: 5,
            price: 48.80
        },
        {
            id: 4,
            imageURL: LongSleeve,
            title: 'Long Sleeves',
            rating: 5,
            price: 21.50
        },
        {
            id: 5,
            imageURL: Pants,
            title: 'Classic Fit Pants',
            rating: 4,
            price: 36.50
        },
        {
            id: 6,
            imageURL: Nike,
            title: 'White Nike Shoes',
            rating: 5,
            price: 100.99
        },
        {
            id: 7,
            imageURL: Jeans,
            title: 'Jeans',
            rating: 5,
            price: 40.99
        },
        {
            id: 8,
            imageURL: Sneakers,
            title: 'Black Sneakers',
            rating: 5,
            price: 83.99
        }
    ];

    return (
        <div className="fashion-page">
            <h2>Fashion Items</h2>
            <div className="item-list">
                {fashionItems.map((item) => (
                    <Item
                        key={item.id}
                        imageURL={item.imageURL}
                        title={item.title}
                        rating={item.rating}
                        price={item.price}
                    />
                ))}
            </div>
        </div>
    );
};

export default FashionPage;
